SET search_path TO gate_schema;
set DateStyle to DMY;
CREATE TABLE role (
  id SERIAL NOT NULL PRIMARY KEY,
  name CHARACTER VARYING(40) NOT NULL UNIQUE,
  type CHARACTER VARYING(45) NOT NULL,
  status CHARACTER VARYING(50) NOT NULL,
  create_date TIMESTAMP NOT NULL DEFAULT NOW(),
  update_date TIMESTAMP DEFAULT NOW()
);
ALTER SEQUENCE role_id_seq RESTART WITH 100;

CREATE TABLE "user" (
  id BIGSERIAL NOT NULL PRIMARY KEY,
  user_name CHARACTER VARYING(50) NOT NULL UNIQUE,
  email CHARACTER VARYING(50) UNIQUE,
  phone CHARACTER VARYING(15) UNIQUE,
  full_name  CHARACTER VARYING(50),
  password CHARACTER VARYING(200),
  gender CHARACTER VARYING(1),
  address CHARACTER VARYING(50),
  district CHARACTER VARYING(50),
  device_id CHARACTER VARYING(1024),
  city CHARACTER VARYING(50),
  country CHARACTER VARYING(2) DEFAULT 'VN',
  post_code CHARACTER VARYING(10),
  birth_date DATE,
  identity CHARACTER VARYING(50) UNIQUE,
  identity_date DATE,
  identity_place CHARACTER VARYING(50),
  money INT DEFAULT '0',
  rice INT DEFAULT '0',
  seed INT DEFAULT '0',
  point INT DEFAULT '0',
  exp INT DEFAULT '0',
  level VARCHAR(20) DEFAULT 'BRONZE',
  login_count INT DEFAULT '0',
  vip VARCHAR(20) DEFAULT NULL,
  photo CHARACTER VARYING(100),
  notify BOOLEAN DEFAULT true,
  provider VARCHAR(20),
  external_id CHARACTER VARYING(30), 
  type VARCHAR(20) DEFAULT 'PERSONAL',
  attend CHARACTER VARYING(100),
  verify_code CHARACTER VARYING(6),
  verify_key CHARACTER VARYING(200),
  refer_code VARCHAR(10),
  friend_code VARCHAR(10),
  status CHARACTER VARYING(40) NOT NULL,
  create_date TIMESTAMP DEFAULT NOW(),
  update_date TIMESTAMP DEFAULT NOW()
);
ALTER SEQUENCE user_id_seq RESTART WITH 1000;

